var rxFSfi = ''
var rxFSsy = ''
var rxFSfi = new Array()
var rxFSsy = new Array()
var Search, i;

const file = 'data:image/svg+xml;base64,';
const wenj = 'data:image/svg+xml;base64,';

(function (Scratch) {
    'use strict';

    class rxFS {
        getInfo() {
            return {
                id: 'rxfs',
                name: 'rxFS',
                docsURI: 'https://0832k12.github.io/rxFS/',
                color1: '#2bdab7',
                blocks: [
                    {
                        blockIconURI: wenj,
                        opcode: 'start',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'New [STR] ',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            }
                        }
                    },
                    {
                        blockIconURI: wenj,
                        opcode: 'file',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'Set [STR] to [STR2] ',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            },
                            STR2: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'rxFS is good!'
                            }
                        }
                    },
                    {
                        blockIconURI: wenj,
                        opcode: 'sync',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'Set the location of [STR] to [STR2] ',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            },
                            STR2: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            }
                        }
                    },
                    {
                        blockIconURI: wenj,
                        opcode: 'del',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'Delete [STR] ',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            }
                        }
                    },
                    {
                        blockIconURI: wenj,
                        opcode: 'webin',
                        blockType: Scratch.BlockType.REPORTER,
                        text: 'GET [STR]',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'https://0832k12.github.io/rxFS/hello.txt'
                            }
                        }
                    },
                    {
                        blockIconURI: wenj,
                        opcode: 'open',
                        blockType: Scratch.BlockType.REPORTER,
                        text: 'Open [STR]',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            }
                        }
                    },
                    {
                        blockIconURI: file,
                        opcode: 'clean',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'Clean Filesystem',
                        arguments: {}
                    },
                    {
                        blockIconURI: file,
                        opcode: 'in',
                        blockType: Scratch.BlockType.COMMAND,
                        text: 'Import Filesystem [STR]',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÅ'
                            }
                        }
                    },
                    {
                        blockIconURI: file,
                        opcode: 'out',
                        blockType: Scratch.BlockType.REPORTER,
                        text: 'Export File system',
                        arguments: {}
                    },
                    {
                        blockIconURI: file,
                        opcode: 'list',
                        blockType: Scratch.BlockType.REPORTER,
                        text: 'List files of [STR]',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÅ'
                            }
                        }
                    },
                    {
                        blockIconURI: file,
                        opcode: 'search',
                        blockType: Scratch.BlockType.REPORTER,
                        text: 'Search [STR]',
                        arguments: {
                            STR: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: 'üìÉ'
                            }
                        }
                    }
                ]
            };
        }


        clean() {
            rxFSfi = [];
            rxFSsy = [];
        }

        sync({ STR, STR2 }) {
            if (rxFSsy.indexOf(STR) + 1 == 0) {
                rxFSsy[((rxFSsy.indexOf(STR) + 1) - 1)] = STR2;
            }
        }

        start({ STR }) {
            if (!(STR.charAt((STR.length - 1)) == '/') && rxFSsy.indexOf(STR) + 1 == 0) {
                rxFSfi.splice(((rxFSfi.length + 1) - 1), 0, null);
                rxFSsy.splice(((rxFSsy.length + 1) - 1), 0, STR);
            }
        }

        open({ STR }) {
            return rxFSfi[((rxFSsy.indexOf(STR) + 1) - 1)];
        }

        del({ STR }) {
            rxFSfi[((rxFSsy.indexOf(STR) + 1) - 1)] = undefined;
            rxFSsy[((rxFSsy.indexOf(STR) + 1) - 1)] = undefined;
        }

        file({ STR, STR2 }) {
            rxFSfi[((rxFSsy.indexOf(STR) + 1) - 1)] = STR2;
        }

        search({ STR }) {
            Search = '';
            i = 0;
            for (var i in rxFSsy) {
                if (!(rxFSsy[(i)].indexOf(STR) == undefined)) {
                    Search = [Search, ',', rxFSsy[(i)]].join('');
                }
            }
            return Search;
        }

        list({ STR }) {
            Search = '';
            i = 0;
            for (var i in rxFSsy) {
                if (rxFSsy[(i)].slice(0, STR.length) == STR) {
                    Search = [Search, ',', rxFSsy[(i)]].join('');
                }
            }
            return Search;
        }

        webin({ STR }) {
            return fetch(STR)
                .then((response) => {
                    return response.text();
                })
                .catch((error) => {
                    console.error(error);
                    return 'undefined';
                });
        }

        in({ STR }) {
            rxFSfi = STR.slice(0, STR.indexOf('|')).split(',');
            rxFSsy = STR.slice(((STR.indexOf('|') + 1)), STR.length).split(',');
        }

        out() {
            return [rxFSfi.join(','), '|', rxFSsy.join(',')].join('');
        }
    }

    Scratch.extensions.register(new rxFS());
})(Scratch);
